import {Redirect, Route, Switch} from "react-router-dom";
import Layout from "./components/layout/Layout";
import React, {Suspense} from "react";
import LoadingSpinner from "./components/UI/LoadingSpinner";

const NewQuote = React.lazy(() => import('./components/pages/NewQuote'))
const QuoteDetail = React.lazy(() => import("./components/pages/QuoteDetail"))
const AllQuotes = React.lazy(() => import('./components/pages/AllQuotes'))
function App() {
    return (
        <Layout>
            <Suspense fallback={<div className='centered'>
                <LoadingSpinner/>
            </div>}>
                <Switch>
                    <Route path='/' exact>
                        <Redirect to='/quotes'/>
                    </Route>
                    <Route path='/quotes' exact>
                        <AllQuotes/>
                    </Route>
                    <Route path='/quotes/:quoteId'>
                        <QuoteDetail/>
                    </Route>
                    <Route path='/new-quote'>
                        <NewQuote/>
                    </Route>
                </Switch>
            </Suspense>
        </Layout>
    );
}

export default App;
